paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 3:
        {
            value = (value < 0 ? 0 : (value > 8000 ? 8000 : value));
            let normalizedValue = (value - 0) / (8000 - 0);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < 5 ? 5 : (value > 12 ? 12 : value));
            let normalizedValue = (value - 5) / (12 - 5);
            return normalizedValue;
        }
    case 4:
        {
            value = (value < 20 ? 20 : (value > 2000 ? 2000 : value));
            let normalizedValue = (value - 20) / (2000 - 20);
            return normalizedValue;
        }
    case 2:
        {
            value = (value < 0.001 ? 0.001 : (value > 0.999 ? 0.999 : value));
            let normalizedValue = (value - 0.001) / (0.999 - 0.001);
            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (1 - 0);
            }
        }
    case 3:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (8000 - 0);
            }
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 5 + value * (12 - 5);
            }
        }
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 20 + value * (2000 - 20);
            }
        }
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0.001 + value * (0.999 - 0.001);
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 1:
        {
            v = (v > 12 ? 12 : (v < 5 ? 5 : v));
            return v;
        }
    case 2:
        {
            v = (v > 0.999 ? 0.999 : (v < 0.001 ? 0.001 : v));
            return v;
        }
    case 3:
        {
            v = (v > 8000 ? 8000 : (v < 0 ? 0 : v));
            return v;
        }
    case 4:
        {
            v = (v > 2000 ? 2000 : (v < 20 ? 20 : v));
            return v;
        }
    default:
        return value;
    }
}
